import  React  from "react";


function Login(){
  return(
    <div>
      <h1>Login Page</h1>
      <input placeholder="Enter Name" type="text" name="email"></input>
      <input type="password" placeholder="Enter Password" name="password"></input>
      <input type="button"> </input>
    </div>
  )
}
